import React from 'react';

function Languages() {
  return (
    <div className="languages">
      <h2>Language</h2>
      <ul>
        <li><strong>English | Proficient</strong>
          <ul>
            <li>TOEIC (950/990), OPIc (IH)</li>
          </ul>
        </li>
        <li><strong>Korean | Native</strong></li>
      </ul>
    </div>
  );
}

export default Languages;
